import { Route, Link } from 'react-router-dom';
import AnimeList from './AnimeList'

const Action = (props) => {
    return(
        <Route exact path="/">
			{
			props.animes.map(anime => {
			    return <AnimeList 
							key={anime._id}
							anime={props.anime}
							deleteAnime={props.deleteAnime}
							editAnimeBtnClickHandler={props.editAnimeBtnClickHandler}
							addReviewBtnClickHandler={props.addReviewBtnClickHandler}
                            />
						})

			}	
		</Route>
    );
}

export default Action;
